package firstApp;

public class Typecasting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
double a = 100.05;
		long b = (long) a;
		int i =  (int)b;
		System.out.println("double value " +a);
	System.out.println("long value" +b);
	System.out.println("integer value" +i);
	
	}

}
